import React from "react";
import { products } from "../assets/index";
import Product from "../components/Product";

const Products = () => {
  return (
    <section class="py-5">
      <div class="container">
        <div class="row"></div>
        {products.map((product) => {
          return (
            <Product
              key={product.id}
              id={product.id}
              name={product.name}
              desc={product.desc}
              price={product.price}
            ></Product>
          );
        })}
      </div>
    </section>
  );
};

export default Products;
